import { Route, Routes } from "react-router-dom";
import "./App.css";

import Navbar from './Components/Navbar'
import Home from './Pages/Home'
import Dashboard from './Pages/Dashboard'
import Regestration_step1 from './Pages/Regestration_step1'
import Regestration_step2 from './Pages/Regestration_step2'
function App() {
  return (
    <div>
      <div>
      <Navbar/>
      </div>
        <Routes>
            <Route path="/" element={<Home></Home>}/>
            <Route path="/regestration-step-1" element={<Regestration_step1/>}/>
            <Route path="/regestration-step-1" element={<Regestration_step2/>}/>
            <Route path="/dashboard" element={<Dashboard/>}/>
        </Routes>

    </div>
  );
}

export default App;
